import React from 'react'
import pingpong from "../../assets/images/pingpong.png";
import cercleCarrer from "../../assets/images/cercleCarrer.png";
import cuillere from "../../assets/images/cuillere.png";
import oeil from "../../assets/images/oeil.png";
import main from "../../assets/images/main.png";
import train from "../../assets/images/trains.png";
import DivImgTextWorkCompont from '../../componentReutilisable/WorkComponent/DivImgTextWorkCompont'
import tabImg from '../../tools/tab/work/TabImg';
import tabTranslate from '../../tools/tab/work/TabTranslate';
import tabTexte from '../../tools/tab/work/TabTexte';

export default function ContenuWork() {
  return (
    <div className="supp1024:h-[76%] h-[85%] w-full flex flex-col items-center justify-evenly ">
        <div className="allSousDiv   supp1024:flex-row flex flex-col items-center justify-evenly h-[33.3%] w-full mb-0 transform translate-y-[-40%] opacity-0 ">
            <DivImgTextWorkCompont translate={tabTranslate[0]} alt={tabImg.alt[0]} titre={tabTexte.titre[0]} src={tabImg.srcImg[0]} tab={tabTexte.texte[0]} ></DivImgTextWorkCompont>
            <DivImgTextWorkCompont translate={tabTranslate[1]} alt={tabImg.alt[1]} titre={tabTexte.titre[1]} src={tabImg.srcImg[1]} tab={tabTexte.texte[1]} ></DivImgTextWorkCompont>
        </div>
        <div className=" allSousDiv   supp1024:flex-row flex flex-col items-center justify-evenly h-[33.3%] w-full mb-0 transform translate-y-[-40%] opacity-0  ">
            <DivImgTextWorkCompont translate={tabTranslate[2]} alt={tabImg.alt[2]} titre={tabTexte.titre[2]} src={tabImg.srcImg[2]} tab={tabTexte.texte[2]}  ></DivImgTextWorkCompont>
            <DivImgTextWorkCompont translate={tabTranslate[3]} alt={tabImg.alt[3]} titre={tabTexte.titre[3]} src={tabImg.srcImg[3]} tab={tabTexte.texte[3]}  ></DivImgTextWorkCompont>
        </div>
        <div className="allSousDiv  supp1024:flex-row  flex flex-col items-center justify-evenly h-[33.3%] w-full mb-0 transform translate-y-[-40%] opacity-0  ">
            <DivImgTextWorkCompont translate={tabTranslate[4]} alt={tabImg.alt[4]} titre={tabTexte.titre[4]} src={tabImg.srcImg[4]} tab={tabTexte.texte[4]}  ></DivImgTextWorkCompont>
            <DivImgTextWorkCompont translate={tabTranslate[5]} alt={tabImg.alt[5]} titre={tabTexte.titre[5]} src={tabImg.srcImg[5]} tab={tabTexte.texte[5]}  ></DivImgTextWorkCompont>
        </div>
    </div>
  )
}
